var url =["https://i.imgur.com/EJx2U0C.png", "https://i.imgur.com/y50USGZ.png","https://i.imgur.com/ebLoCsL.jpg", "https://i.imgur.com/EJx2U0C.png", "https://i.imgur.com/Q1PPCDJ.jpg", "https://pbs.twimg.com/media/FGLp1SaWUAIi2uw?format=jpg&name=medium", "https://i0.wp.com/hieroglyphics.com/wp-content/uploads/2021/10/Hiero2.jpg?w=1000&ssl=1"]

let numSecs=5 // number of seconds

//-----------Nothing to touch here-----------
i=0
setInterval(()=>{
  if(i!=url.length){
    feature.set({url:url[i]})
    i++
  }else{
    i=0
  }
},numSecs*1000)

console.log('closed') //Curtain starts off closed

let raisefrontcurtain = parcel.getFeatureById('Front Curtain')
let lowerfrontcurtain = parcel.getFeatureById('Front Curtain')

let r1 = raisefrontcurtain.createAnimation('position')
let r2 = lowerfrontcurtain.createAnimation('position')




feature.on('click', e => {
    if (console.log = 'closed') {
        r1.setKeys([{
frame: 95, // standard is 30 fps (means it take 1 second)
value: raisefrontcurtain.position.add( new Vector3(0,8,0) )
}])

raisefrontcurtain.startAnimations( [r1] ) //Starts the animation
console.log('open')
    //This raises the curtain when the button is clicked
    } else if (console.log = 'closed') {
        r2.setKeys([{
frame: 95, // standard is 30 fps (means it take 1 second)
value: lowerfrontcurtain.position.add( new Vector3(0,0,0) )
}])

lowerfrontcurtain.startAnimations( [r2] ) //Starts the animation
console.log('closed')
    //This lowers the curtain when the button is clicked
    }
})
